  <script>
    var slider = document.getElementById('slider');

    noUiSlider.create(slider, {
      start: [180, 600],
      connect: [true, true, true],
      step: 10,
      padding: [10, 10],
      range: {
        'min': 0,
        'max': 10010
      }
    });

    slider.noUiSlider.on('update', function (values, handle) {
      range0 = parseInt(values[0]);
      range1 = parseInt(values[1]);
      document.getElementById('slider1val').value = range0;
      document.getElementById('slider21val').value = range0;
      document.getElementById('slider22val').value = range1;
      document.getElementById('slider3val').value = range1;
    });

    slider.noUiSlider.on('end', function (values, handle) {
      map.removeLayer(g_layer);
      g_layer = initGeojsonLayer();
      g_layer.addTo(map);
    });

    var connect = slider.querySelectorAll('.noUi-connect');
    var classes = ['c-1-color', 'c-2-color', 'c-3-color'];

    for (var i = 0; i < connect.length; i++) {
      connect[i].classList.add(classes[i]);
    }

    function showOrHide() {
      map.removeLayer(g_layer);
      g_layer = initGeojsonLayer();
      g_layer.addTo(map);
    }

    function setHeatMapRadius(radius) {
      heat_layer.setOptions({ radius: parseInt(radius) });
    }
  </script>>
